import{_ as e,o as r,c as a,O as t}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 32.1-162.30 Annual report.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/32.1-162.30.md","filePath":"vacode/32.1-162.30.md"}'),n={name:"vacode/32.1-162.30.md"},o=t('<h1 id="§-32-1-162-30-annual-report" tabindex="-1">§ 32.1-162.30 Annual report. <a class="header-anchor" href="#§-32-1-162-30-annual-report" aria-label="Permalink to &quot;§ 32.1-162.30 Annual report.&quot;">​</a></h1><p>The Board shall submit to the Governor and the General Assembly an annual executive summary of the interim activity and work of the Board no later than the first day of each regular session of the General Assembly. The executive summary shall be submitted as a report document as provided in the procedures of the Division of Legislative Automated Systems for the processing of legislative documents and reports and shall be posted on the General Assembly&#39;s website. The executive summary shall include information regarding research efforts supported by the Board and expenditures from the Fund.</p><p>1997, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?971+ful+CHAP0803" target="_blank" rel="noreferrer">803</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?971+ful+CHAP0888" target="_blank" rel="noreferrer">888</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?971+ful+CHAP0891" target="_blank" rel="noreferrer">891</a>, § 23-286; 2016, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?161+ful+CHAP0588" target="_blank" rel="noreferrer">588</a>.</p>',3),i=[o];function s(l,c,d,h,p,f){return r(),a("div",null,i)}const m=e(n,[["render",s]]);export{_ as __pageData,m as default};
